package oops;

public class nested_for {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int i=1; i<=5; i++) {           //outer loop (row)
			for (int j=1; j<=5; j++) {       //Inner loop (column)
				System.out.print(j);
			}
		   System.out.println();
		}

	}

}
//12345
//12345
//12345
//12345
//12345